window.bookSummaryJSON = "<p><b>They want an heir and I’m the only way they can get it. With or without my cooperation.</b><br> <br> I thought Cadieux Island would be a new beginning, but the privileged estates and elite college turned into a nightmare.<br> My once tormentor and his twin brother somehow became my unlikely saviors while the grandparents, I didn’t know existed, lured me here with the promise of family have shown themselves to be the true tyrants.<br> <br> The Umbra’s want an heir and I’m the only way they can get it, but I’m not the same girl I was when I stepped onto this island. The Morningstar twins have honed me, sharpened me into something my family will never see coming.<br> <br> <b><i>Honed in Havoc is the final book in the Corrupt Credence series. A dark college romance with mature content for adult listeners.</i></b><i> </i></p>"; 
